import './App.css';
import EquipmentComponent from './Components/EquipmentComponent';

function App() {
  return (
    <div className="w-full h-full bg-blue-300 flex justify-center space-x-[5rem]">
        <EquipmentComponent component='Booth' width={300}/>
        <EquipmentComponent component='MovingHead'/>
        <EquipmentComponent component='SpeakerWithBass'/>
        <EquipmentComponent component='Booth'/>
        <EquipmentComponent component='SpeakerWithBass'/>
        <EquipmentComponent component='MovingHead'/>
        <EquipmentComponent component='Speaker'/>
    </div>
  );
}

export default App;
